      <p class="mt-3 text-sm leading-5 md:mt-0 md:ml-6">
        <a href="https://fs.blog/2015/01/richard-feynman-knowing-something/" class="whitespace-no-wrap font-medium text-blue-700 hover:text-blue-600 transition ease-in-out duration-150">
          Feynman &rarr;
        </a>
      </p>
    </div>
  </div>
    </div>
    <h2>{`Kinds of Ranges`}</h2>
    <p>{`Swift gives us two ways of creating ranges. Half-Open range, and Closed Range.`}</p>
    <h3>{`Half-Open Range`}</h3>
    <p>{`The `}<em parentName="p">{`Half-Open`}</em>{` range operator is declared with `}<inlineCode parentName="p">{`..<`}</inlineCode>{` between a numeric pair.
Using a `}<inlineCode parentName="p">{`Range`}</inlineCode>{` instance, you can quickly check to see if a value is contained in a particular range of values. This creates a range up to but `}<strong parentName="p">{`not`}</strong>{` including the upper bound value.`}</p>
