    <p><em parentName="p">{`Range`}</em>{` can also be used to specify a collection of consecutive, `}<em parentName="p">{`strideable`}</em>{` values, usually Integers. It can also be used in `}<inlineCode parentName="p">{`for-in`}</inlineCode>{` loops or with any sequence or collection method. The results of the range include all values up to, but `}<strong parentName="p">{`not`}</strong>{` including the upperBound.`}</p>
